  Mangatoitoi Station
  Andrew Hamilton Russell purchased "Mangatoitoi" station in 1930 from Randall Sherratt and farmed there
  until he retired to Gisborne in 1966. He was one of the pioneers of aerial topdressing and this greatly
  improved the productivity of this medium to steep hill country property. After he retired the property was
  farmed by his daughter, Katherine Mary Cave (nee Russell) and her husband Adrian Michael Cave. In 1989
  their eldest son, Philip Russell Cave, became involved in the running of the property.
